import React, { useState } from 'react'
import Login from './Login'

const Home = () => {
    const [selectHome, setSelectHome] = useState('login')

    const ondisplay = (type) => {
        if (type === "login") {
            setSelectHome("login")
        } else {
            setSelectHome("register")
        }

    }
    return (
        <div>
            {
                selectHome === "login" ? (
                    <div>
                        <Login />
                        <p>or</p>
                        <p onClick={() => ondisplay("register")}>Create Account</p>
                    </div>
                ) :
                    <div>
                        


                    </div>
            }
        </div>
    )
}

export default Home
